import Catalog from "./components/Catalog";
import SortTable from "./components/SortTable";
import {
  BrowserRouter as Router,
  Route,
  Link} from 'react-router-dom';


function App() {
  return (
      <Router>
        <header>
          <nav>
            <ul>
              <li>
                <Link to="/">Главная</Link>
              </li>
              <li>
                <Link to="/catalog">Каталог</Link>
              </li>
            </ul>
          </nav>
        </header>

        <main>
            <Route path="/">
              <SortTable />
            </Route>
            <Route path="/about">
              <Catalog />
            </Route>
        </main>
      </Router>
  );
}

export default App;
